import React, {Component} from 'react';
import { Col } from 'reactstrap';

import Parent from './Description';

class GitDisc extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Col>
          <p className="card-text">{this.props.description}</p>
      </Col>
    );
  }
}

export default GitDisc;
